    "Population status and reproductive success of cliff-nesting seabirds at Bluff,
    Alaska in 1985: Report of field results",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:24.470356",nt"name": "population-status-and-reproductive-success-of-cliff-nesting-seabirds-at-bluff-alaska-in-19",nt"isopen":
    false,nt"url": null,nt"notes": "In 1985 fieldwork was conducted at the
    Bluff colony in Norton Sound to provide a continuing assessment of numbers and reproductive
    performance of Common Murres (Uria aalge) and Black-legged Kittiwakes (Rissa tridactyla).
    These species occupy similar trophic positions, but kittiwakes forage at relatively
    short distances from breeding colonies and feed at or near the sea surface; in contrast,
    murres are capable of foraging at much further distances from colonies and at depth.
    Thus kittiwakes are very sensitive indicators of environmental changes that affect
    food availability in surface waters near breeding colonies, while murres can be
    viewed appropriately as indicators of more generalized and widespread changes in
    ecological conditions. We secondarily have focused on Pelagic Cormorants (Phalacrocorax
    pelagicus) because they apparently have demonstrated at least moderate reproductive
    success in years when kittiwakes and murres have failed to breed successfully. In
    this report we summarize the 1985 fieldwork and briefly discuss the results in relation
    to those obtained over the previous ten years.",nt"license_title": "License
